import React from 'react';

const DisplayAnnouncementFirst = (props) => {
    return (
        <div>
            {props.initial.map((p, idx) =>
                <div key={idx}>
                    <div>{p.title}</div>
                    <div>{p.description}</div>
                </div>
            )}
        </div>
    );
};

export default DisplayAnnouncementFirst;
